export function Cart(propss) {
    return <div className="col-md-6">
        <h3>Cart</h3>
        <div className="col-md-6">
        <table className="col-md-6">
            <thead>
                <tr>
                <th>Title</th>
                <th>Price</th>
                <th>Category</th>
                <th>Count</th>
                <th>Submital</th>
                <th>Actions</th>
                </tr>
            </thead>
            <tbody>
            {
              propss.date2.map(elm => {
                return <tr key={elm.id}>
                  <td>{elm.title}</td>
                  <td>{elm.price}</td>
                  <td>{elm.count}</td>
                  <td>{elm.count * elm.price}</td>
                  <td><button onClick={() => on(elm)}>countUP</button></td>
                  {/* <button onClick={() => Countdown(elm)}>count down</button>
                  <button onClick={() => Delate(elm)}>Delate</button></td> */}

                </tr>
              })
            }
            </tbody>
        </table>
        </div>
    </div>
}


